import React from 'react'

const About = () => {
  return (
    <div className="About">
      <h2>Welcome to Hackathon Teamup</h2>
      <p>Organize your event by registering teams and event participants.  Teams can fill their ranks by finding participants who have the skills they're looking for.</p>
    </div>
  )
}

export default About;
